<h1>
Oreo Milkshake Recipe
</h1>

<p>
A tasty delicious cookie and cream milkshake!
</p>

<h2>
Ingredients
</h2>

<ul>
<li>5 oreos</li>
<li>250ml of milk</li>
<li>blender </li>
<li>whipping cream (optional)</li>
</ul>

<h2>
Instructions
</h2>

<ol>
<li>Place oreos in blender</li>
<li>Pour 250ml of milk</li>
<li>Add whipping cream (optional) </li>
<li>Blend in blender</li>
</ol>
